import React from "react";
import Col from "react-bootstrap/Col";
import Raw from "react-bootstrap/Row";
import Card from 'react-bootstrap/Card';

import './styles.css'

const Price = (props) => {
  return (
    <Raw>
      <a>Empresa</a>
      <Col xs={6} md={4}>
        <Card
          bg="Dark"
          key="Dark"
          text="Dark"
          style={{ width: '18rem' }}
          className="mb-2"
        >
          <Card.Body>
            <Card.Title>$ 2,000.00</Card.Title>
            <Card.Text>
              Some quick example text to build on the card title and make up the
              bulk of the card's content.
            </Card.Text>
          </Card.Body>
        </Card>
      </Col>
      <Col xs={6} md={4}>
        xs=6 md=4
      </Col>
      <Col xs={6} md={4}>
        xs=6 md=4
      </Col>
    </Raw>
  );
};

export default Price;
